import React, { useEffect, useState } from 'react';

function App() {

  const [location, setLocation] = useState({
    lat: null,
    lon: null
  })


  //Get user location
  //Get weather data
  //Display users data based on location
  navigator.geolocation.getCurrentPosition((position)=> {
    const p=position.coords;
    console.log(p.latitude,p.longitude);
    setLocation({
      lat: p.latitude,
      lon: p.longitude
    })
  })


  return (
    <div>
      <h1>Weather app</h1>
    </div>
  );
}

export default App;
